import React from "react";

import CrecheSlider from '../components/CrecheSlider'

const Creche = () => { 
    return ( 
       
        <div className="w-full py-[10rem]  ">  
            <div className="bg-[#FBEDEC]  min-h-[600px]">
                <div className="flex flex-col justify-center px-2 xl:px-0 h-[800px]">
                    <h2 className="h2 text-black text-center mb-[80px]">
                           Nos Creches : 
                    </h2>
                    <CrecheSlider />
                </div>
            </div>
           </div>
       









    





    );
};

export default Creche;
